import React from 'react';
import { Routes, Route } from 'react-router-dom';
import './index.css';

// Placeholder components - to be implemented
const Landing = () => <div className="p-8">Vault5 Landing Page - Financial Freedom Platform</div>;
const Login = () => <div className="p-8">Login Page</div>;
const Register = () => <div className="p-8">Register Page</div>;
const Dashboard = () => <div className="p-8">Dashboard - Net Worth, Allocation Pie, Health Score</div>;
const Reports = () => <div className="p-8">Reports - Cash Flow, Exports</div>;
const Lending = () => <div className="p-8">Lending Module</div>;
const Loans = () => <div className="p-8">Loans Module</div>;
const Investments = () => <div className="p-8">Investments Module</div>;
const Blog = () => <div className="p-8">Blog - Financial Education</div>;
const Settings = () => <div className="p-8">Settings - Allocations, Notifications, Lending Rules</div>;
const Profile = () => <div className="p-8">Profile - Name, Avatar, Preferences</div>;

function App() {
  return (
    <div className="min-h-screen bg-gray-100">
      <Routes>
        <Route path="/" element={<Landing />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/reports" element={<Reports />} />
        <Route path="/lending" element={<Lending />} />
        <Route path="/loans" element={<Loans />} />
        <Route path="/investments" element={<Investments />} />
        <Route path="/blog" element={<Blog />} />
        <Route path="/settings" element={<Settings />} />
        <Route path="/profile" element={<Profile />} />
      </Routes>
    </div>
  );
}

export default App;
